    if (numberOfNights == null && parseVaxDate(this.Dep.value) != null && parseVaxDate(this.Ret.value) != null) {
        this.Length = getDateDiffDays(this.Dep.value, this.Ret.value);
    }
    else {
        this.Length = null;
    }
