    this.Dep.arrCtrlsToUpdate = new Array(this.ChkIn, this.PiUp);
    this.Ret.arrCtrlsToUpdate = new Array(this.ChkOut, this.DrOff);
    this.Dep.arrCtrlsToAddDayLength = new Array(this.Ret, this.ChkOut, this.DrOff);
