function promocode_checkkey(evt) {
    if (typeof evt.keyCode != 'undefined') {
        if (evt.type != 'keyup') return;
        var objevt = evt.target || evt.srcElement;
        var kc = evt.keyCode;
        if (kc != 37 && // Left Arrow
            kc != 39 && // Right Arrow
            kc != 8 && // Backspace
            kc != 46)  // Delete
        {
            objevt.value = objevt.value.toUpperCase();
        }
    }
}

